INSERT INTO `news` VALUES (71, '2021-04-24 23:06:28', '手慢无,特斯拉专座限时抢购', '马斯克亲自驾驶的特斯拉专座,开放购买了', 'http://localhost:8080/springboot0t1t7/upload/1708786090111.jpg', '<p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p><p><br></p><p><br></p><p><strong>1.在线预订汽车票流程</strong></p><p><br></p><p>输入出发到达城市及日期→选择合适的车次并点击预订→填写乘车人和取票人信息→提交订单→支付订单→出票</p><p><br></p><p><strong>2.如何取票</strong></p><p><br></p><p>购票成功后，会有短信发送到您预留的取票人手机上。建议凭该取票信息和身份证件等，在自助取票机取票或将取票信息提供给车站工作人员取票。</p><p><br></p><p><strong>3.为什么有些线路查不到结果</strong></p><p><br></p><p>您查询的线路可能尚未开通网上售票，或者是车站当天没有车次，建议切换日期或重新输入出发到达城市搜索。</p><p><br></p><p><strong>4.预售期是多久</strong></p><p><br></p><p>通常携程支持购买各汽车站10天内的车票，具体预售期以各车站为准。同时，您也可使用预约购票功能，一旦车站开始售票，我们会第一时间为您出票</p>');
INSERT INTO `news` VALUES (74, '2021-04-24 23:06:28', '极端天气停运通知', '受极端冰雪天气影响,本站所有汽车停运', 'http://localhost:8080/springboot0t1t7/upload/1708786230031.jpg', '<p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p><p><br></p><p><br></p><p><strong>1.在线预订汽车票流程</strong></p><p><br></p><p>输入出发到达城市及日期→选择合适的车次并点击预订→填写乘车人和取票人信息→提交订单→支付订单→出票</p><p><br></p><p><strong>2.如何取票</strong></p><p><br></p><p>购票成功后，会有短信发送到您预留的取票人手机上。建议凭该取票信息和身份证件等，在自助取票机取票或将取票信息提供给车站工作人员取票。</p><p><br></p><p><strong>3.为什么有些线路查不到结果</strong></p><p><br></p><p>您查询的线路可能尚未开通网上售票，或者是车站当天没有车次，建议切换日期或重新输入出发到达城市搜索。</p><p><br></p><p><strong>4.预售期是多久</strong></p><p><br></p><p>通常携程支持购买各汽车站10天内的车票，具体预售期以各车站为准。同时，您也可使用预约购票功能，一旦车站开始售票，我们会第一时间为您出<img src=\"http://localhost:8080/springboot0t1t7/upload/1708786288040.png\"></p>');

